import  React,{ Component } from "react";
import { Media, Navbar } from "react-bootstrap";
import axios from 'axios';
import VideoPlayer from './VideoPlayer';

class VideoLists extends Component
{ 
    state = {
        items : []
    }

  async  getData() {
      const response = await axios.get('https://cors-anywhere.herokuapp.com/https://openwhyd.org/hot/electro?format=json ')
      this.setState({items: response.data.tracks})
     console.log(response.data.tracks);

    }
    componentDidMount() {
        this.getData1()    
}

    async getData1() {
     await    axios.get('https://cors-anywhere.herokuapp.com/https://openwhyd.org/hot/classical?format=json ')
        .then(response => {
            this.setState({
              items: response.data.tracks  });
          })
}    
    render() {

        const play = this.state.items.map((item) => {
            let s = item.eId;
            let res = s.split("/");
            return res[2];
        })
        console.log(play)
        const listItems = this.state.items.map((item, i) =>
            <div>
                <Media as="li">
                <img
      width={164}
      height={164}
      className="mr-3"
      src={item.img}
      alt="No image"
    />

                </Media>
                < li > {item.name}  </li>
                <img src={item.img} alt="no"></img>
                <VideoPlayer
                    url={`https://www.youtube.com/watch?v=${play[i++]}`} ></VideoPlayer>
            </div>
        )

        return (
            <div>
               <Navbar style={{backgroundColor:'aquamarine', width:'100%', height:'50px', top:'0px'}}>
                        <Navbar.Brand >
                            <h1>Brand link</h1></Navbar.Brand>
                </Navbar>
                <ul className="list-styled">

                </ul>
             </div>
      )
  }

}

export default VideoLists;
